BlocklyGamesMsg["Music.helpText1"] = "Compose the first four notes of 'Frère Jacques'.";
BlocklyGamesMsg["Music.helpText2a"] = "A 'function' allows you to group blocks together, then run them more than once.";
BlocklyGamesMsg["Music.helpText2b"] = "Create a function to play the first four notes of 'Frère Jacques'. Run that function twice.  Don't add any new note blocks.";
BlocklyGamesMsg["Music.helpText3"] = "Create a second function for the next part of 'Frère Jacques'. The last note is longer.";
BlocklyGamesMsg["Music.helpText4"] = "Create a third function for the next part of 'Frère Jacques'. The first four notes are shorter.";
BlocklyGamesMsg["Music.helpText5"] = "Complete the full tune of 'Frère Jacques'.";
BlocklyGamesMsg["Music.helpText6a"] = "This new block lets you change to another instrument.";
BlocklyGamesMsg["Music.helpText6b"] = "Play your tune with a violin.";
